function Portfolio() {
  return (
    <div>
      <motion.div 
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 0.8, ease: 'easeOut', delay: 0.2 }}
      >
        <Bio meta={bioMeta}/>
      </motion.div>
      <div style={{display:'flex', justifyContent:'center'}}>
        <AppContributions/>
